description:
Eden, getrouwd en moeder van de 5-jarige Leonie, valt als een blok voor de verleidelijke keuken van excentriek meesterkok Gregor. De twee zien elkaar steeds vaker in Gregors keuken, waar Gregor de dankbare Eden het een na het andere fantastische gerecht voorschotelt. De geheime culinaire ontmoetingen bevrijden beiden uit de dagelijkse sleur. Edens huwelijk bloeit zichtbaar op en ze raakt eindelijk zelfs weer zwanger. Geheimen zijn echter moeilijk te bewaren in het dorpje waar ze wonen. Als Edens man het eten van Gregor proeft, begrijpt hij dat hij snel wat moet doen om zijn vrouw niet te verliezen...
